    [],nt"revision_timestamp": "2016-07-27T22:21:12.961771",nt"name": "ruby-lake-national-wildlife-refuge-ruby-valley-nevada-1993-annual-water-management-report-",nt"isopen":
    false,nt"url": null,nt"notes": "Although the winter of 1992/93 brought
    above average snow pack water content to the Ruby Mountains and above average precipitation,
    the surface water elevations of the marsh (South Sump) remained 1.4ft below objective
    at its peak in 1993. The combination of below average precipitation at the Refuge
    and below average percent water content of the Ruby Mountains snow pack, for eight
    consecutive years (1985-1992), has resulted in surface water elevations that have
    been below objective levels since 1987. The lack of precipitation has caused a significant
    deficit in ground water and a subsequent decline in the basin water table. The present
    situation of below objective water levels in the marsh will only be reversed following
    consecutive years of above average precipitation. Excess precipitation is required
    to first replenish groundwater and thus increase the water table.",nt"license_title":
